import React from 'react';
import { Link } from 'react-router-dom';
import logo from './imagesComponents/VerdeBendito.png'; // Update the import statement to match your image location

function Navbar() {
  return (
    <div className='navbar'>
      <div className='logo'>
        <img src={logo} alt="Verde Bendito Logo" /> {/* Update the alt text */}
      </div>
      <ul className='navbar-menu'>
        <li><Link to="/">home</Link></li>
        <li><Link to="/Secondpage">secondpage</Link></li>
        <li><Link to="/Contact">contact</Link></li>
      </ul>
    </div>
  );
}

export default Navbar;
